import './App.scss';
import './assets/flicker-animation.scss'
import HomeSection from "./sections/home"

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className="header-nav">
          <p>Home</p>
        </div>
      </header>
      <HomeSection/>
    </div>
  );
}

export default App;
